import "./Navbar.css";
import styled from "styled-components";

const Navbar = () => {
  return (
    <nav className="nav-bar">
      <div class="container">
        <div class="nav-logo">
          <div class="imgBox">
            <h1>
              <a href="homepage.html"> StarWars </a>
            </h1>
          </div>
        </div>

        <div class="ul-list">
          <ul>
            <li>
              <a href="homepage.html">Home</a>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
